CREATE TABLE `notes` (
  `noteid` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) DEFAULT NULL,
  `content` longtext DEFAULT NULL,
  `date` date DEFAULT NULL,
  `user_id` int(10) DEFAULT NULL,
  PRIMARY KEY (`noteid`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

