/*Table structure for table `tbl_dv` */

DROP TABLE IF EXISTS `tbl_dv`;

CREATE TABLE `tbl_dv` (
  `docno` varchar(100) NOT NULL,
  `date` date NOT NULL,
  `type` varchar(50) NOT NULL,
  `obrno` varchar(20) NOT NULL,
  `acctype` varchar(20) NOT NULL,
  `dvno` varchar(20) NOT NULL,
  `acctno` varchar(20) NOT NULL,
  `chequeno` varchar(20) NOT NULL,
  `payee` varchar(20) NOT NULL,
  `particulars` longtext NOT NULL,
  `amount` double(10,2) NOT NULL,
  `creator` varchar(300) NOT NULL,
  `origin` varchar(150) NOT NULL,
  `destination` varchar(150) NOT NULL,
  `status` longtext DEFAULT NULL,
  `remarks` longtext DEFAULT NULL,
  `Filenames` longtext DEFAULT NULL,
  `print` varchar(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`docno`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `tbl_dv` */

/*Table structure for table `tbl_employee` */

DROP TABLE IF EXISTS `tbl_employee`;

CREATE TABLE `tbl_employee` (
  `EmployeeNo` varchar(30) NOT NULL,
  `LastName` varchar(30) DEFAULT ' ',
  `FirstName` varchar(30) DEFAULT ' ',
  `MiddleName` varchar(30) DEFAULT ' ',
  `EmploymentType` varchar(30) DEFAULT NULL,
  `DesignationCode` varchar(30) DEFAULT NULL,
  `DepartmentCode` varchar(30) DEFAULT NULL,
  `Status` enum('Active','Deleted') DEFAULT 'Active',
  PRIMARY KEY (`EmployeeNo`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

