/*Table structure for table `tbl_ledger` */

DROP TABLE IF EXISTS `tbl_ledger`;

CREATE TABLE `tbl_ledger` (
  `docno` varchar(100) NOT NULL,
  `txndate` date NOT NULL,
  `time` time NOT NULL,
  `type` varchar(50) NOT NULL,
  `particulars` longtext NOT NULL,
  `origin` varchar(150) NOT NULL,
  `destination` varchar(150) NOT NULL,
  `status` longtext DEFAULT NULL,
  `remarks` longtext DEFAULT NULL,
  `receiver` varchar(100) NOT NULL,
  `machineid` varchar(300) DEFAULT NULL,
  `start_time` datetime DEFAULT NULL,
  `end_time` datetime DEFAULT NULL,
  PRIMARY KEY (`docno`,`txndate`,`time`),
  KEY `index_docno` (`docno`)
