/*Table structure for table `tbl_ledger_copy` */

DROP TABLE IF EXISTS `tbl_ledger_copy`;

CREATE TABLE `tbl_ledger_copy` (
  `docno` varchar(100) NOT NULL,
  `txndate` date NOT NULL,
  `time` time NOT NULL,
  `type` varchar(50) NOT NULL,
  `particulars` longtext NOT NULL,
  `origin` varchar(150) NOT NULL,
  `destination` varchar(150) NOT NULL,
  `status` longtext DEFAULT NULL,
  `remarks` longtext DEFAULT NULL,
  `receiver` varchar(100) NOT NULL,
  `machineid` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`docno`,`txndate`,`time`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `tbl_ledger_copy` */

/*Table structure for table `tbl_message` */

DROP TABLE IF EXISTS `tbl_message`;

CREATE TABLE `tbl_message` (
  `objid` int(100) NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `sender` varchar(100) NOT NULL,
  `sender_email` varchar(100) NOT NULL,
  `receiver` varchar(100) NOT NULL,
  `subject` varchar(100) NOT NULL,
  `message` longtext NOT NULL,
  `status` varchar(20) NOT NULL DEFAULT 'PENDING',
  PRIMARY KEY (`objid`)
) ENGINE=MyISAM AUTO_INCREMENT=205 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_message` */

