/*Table structure for table `userslog` */

DROP TABLE IF EXISTS `userslog`;

CREATE TABLE `userslog` (
  `objid` int(100) NOT NULL AUTO_INCREMENT,
  `logid` varchar(30) DEFAULT NULL,
  `employeeid` varchar(30) DEFAULT NULL,
  `username` varchar(30) DEFAULT NULL,
  `fullname` varchar(30) DEFAULT NULL,
  `position` varchar(30) DEFAULT NULL,
  `PCName` varchar(30) DEFAULT NULL,
  `IPAddress` varchar(30) DEFAULT NULL,
  `LogInDate` date DEFAULT NULL,
  `LogInTime` varchar(30) DEFAULT NULL,
  `LogOutDate` date DEFAULT NULL,
  `LogOutTime` varchar(30) DEFAULT NULL,
  `Status` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`objid`)
) ENGINE=MyISAM AUTO_INCREMENT=470 DEFAULT CHARSET=latin1;

